CREATE TABLE Quantum_Protocols (
    protocol_id INT PRIMARY KEY,
    protocol_name VARCHAR(255),
    success_rate FLOAT,
    latency_ms INT
);

CREATE TABLE Protocol_Users (
    user_id INT PRIMARY KEY,
    user_name VARCHAR(255),
    protocol_id INT,
    FOREIGN KEY (protocol_id) REFERENCES Quantum_Protocols(protocol_id)
);

CREATE TABLE QuantumProtocols (
    protocol_id INT PRIMARY KEY,
    protocol_name VARCHAR(50) NOT NULL,
    protocol_description TEXT
);

